To determine the total number of pages in the book, let's break down the information given and calculate step by step.

1. The book is read at 2 pages per minute.
2. The book is read in 14 minutes.
3. Therefore, the total number of pages in the book is calculated by multiplying the reading speed by the time taken:
   \[
   \text{Total pages} = 2 \, \text{pages/minute} \times 14 \, \text{minutes} = 28 \, \text{pages}
   \]

So, the book has \(\boxed{28}\) pages. The other details about the pages read in different months are not necessary to find the total number of pages in the book. However, if we were to calculate the total number of pages read over the months, we would add up the pages read each month, but that is not required for this specific question. The answer remains \(\boxed{28}\).```\( \boxed{28} \)```\( \)```{user}
